import React from 'react'
import { CardElement, PaymentElement} from '@stripe/react-stripe-js';


const CheckOut = () => {

  
  return (
  
      <form style={{
        marginTop:"30rem",
      }}>
       
        {/* <PaymentElement/> */}
        <CardElement style={{
          border:'white'
        }}/>
        {/* <PaymentElement/> */}
        <button>submit</button>
       </form>
   
  )
}

export default CheckOut
